// api/colleges.js
import axios from 'axios';

const getCollegesByRank = (rank) => {
  return axios.get(`/colleges/rank/${rank}`);
};

export default axios;  // This makes axios the default export
// or
export { getCollegesByRank }; // You can also export functions like this
